@Override
public Set<User> getAssociatedUsers() {
    Set<User> users = new TreeSet<User>();
    users.add(owner);
    users.add(reporter);
    for (TicketChange changes : ticketChanges) {
        users.add(changes.getExternalAuthor());
    }
    return users;
}
